import React, {useState, useEffect} from 'react';
import ReactDOM from 'react-dom';
import { Link, useHistory } from 'react-router-dom';
import 'antd/dist/antd.css';
import axios from 'axios';
import { Rate, Input } from 'antd';
import {ReviewButton, PostHeader} from './ShowPost';
import { ArrowLeftOutlined } from '@ant-design/icons';
const ReviewList=({postId})=> {
    return (
        <PostHeader style={{borderBottom:'1px solid #E5E5E5', margin:'0', padding:'0'}}>
        <ReviewButton postId={postId} style={{ position:'absolute',left:'5px'}}type="primary">후기 작성</ReviewButton>
      </PostHeader>
    );
 }

 export default ReviewList;
